import web from './images/Service1.jpg';
import app from './images/Service2.jpg';
import software from './images/Service3.png';
import digital from './images/Service4.png';
import android from './images/Service5.svg';
import marketing from './images/Service6.jpg';

const Sdata = [
    {
        imgsrc: web,
        title: "Web Development",
    },
    {
        imgsrc: app,
        title: "App Development",
    },
    {
        imgsrc: software,
        title: "Software Development",
    },
    {
        imgsrc: digital,
        title: "Digital Marketing",
    },
    {
        imgsrc: android,
        title: "Android Development",
    },
    {
        imgsrc: marketing,
        title: "Marketing",
    },
];

export default Sdata;
